import Soccer_Svg from "../static/Soccer_Ball_Background";
import { FiMail } from "react-icons";

const Icon = ({ type }) => {
  switch (type) {
    case "soccer":
      return (
        <Soccer_Svg
          style={{ height: "10px", width: "10px", opacity: 1 }}
          color={"black"}
        />
      );
      break;
    case "mail":
      return FiMail;
  }
};
export default Icon;
